// https://leetcode.com/problems/map-of-highest-peak/

/**
 * @param {number[][]} isWater
 * @return {number[][]}
 */
const highestPeak = function (isWater) {
  const r = isWater.length
  const c = isWater[0].length

  const visited = Array(r).fill().map(() => Array(c).fill(false))

  const q = []
  for (let i = 0; i < r; i++) {
    for (let j = 0; j < c; j++) {
      if (isWater[i][j] == 1) {
        console.log(i, j)
        q.push([i, j])
        visited[i][j] = true
        isWater[i][j] = 0
      }
    }
  }

  const paths = [[1, 0], [-1, 0], [0, 1], [0, -1]]

  const isValid = (i, j) => {
    // out of bounds
    if (i >= 0 && j >= 0 && i < r && j < c && isWater[i][j] == 0) {
      return true
    }
    return false
  }

  let i = 0
  while (i < q.length) {
    console.log(q)
    const [x, y] = q[i++]
    const newHeight = isWater[x][y] + 1
    for (const p of paths) {
      const n_x = x + p[0]
      const n_y = y + p[1]
      if (isValid(n_x, n_y)) {
        if (!visited[n_x][n_y]) {
          isWater[n_x][n_y] = newHeight
          visited[n_x][n_y] = true
          q.push([n_x, n_y])
        }
      }
    }
  }
  return isWater
}

